import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render(){
    return(
      <div id="user_inputs">
        <h4>Please select number of tables and number of cell in the tables</h4>
        <div>
          <p>Number of tables:</p>
          <select></select>
        </div>

        <div>
          <p>Number of cells:</p>
          <select></select>
        </div>
        <input type="submit"></input>
      </div>
    )
  }
}

export default App;
